import React, { useState } from 'react';
import { Button } from 'react-bootstrap';

const SurveyList = ({ surveys, onBack }) => {
  const [currentPage, setCurrentPage] = useState(1);
  const [surveysPerPage] = useState(5);

  // Lógica de paginación
  const indexOfLastSurvey = currentPage * surveysPerPage;
  const indexOfFirstSurvey = indexOfLastSurvey - surveysPerPage;
  const currentSurveys = surveys.slice(indexOfFirstSurvey, indexOfLastSurvey);

  // Función para obtener las preguntas y datos relevantes
  const getSurveyData = (survey) => {
    const questions = survey.summary?.labels || [];
    const description = survey.settings?.description || '';
    const submissions = survey.deployment__submission_count || 0;
    const name = survey.name || '';
    const status = survey.deployment_status === 'deployed' ? 'Activa' : 'Inactiva';
    const dateCreated = new Date(survey.date_created).toLocaleDateString('es-ES');

    return {
      questions,
      description,
      submissions,
      name,
      status,
      dateCreated
    };
  };

  const nextPage = () => {
    if (currentPage < Math.ceil(surveys.length / surveysPerPage)) {
      setCurrentPage(currentPage + 1);
    }
  };

  const prevPage = () => {
    if (currentPage > 1) {
      setCurrentPage(currentPage - 1);
    }
  };

  return (
    <div className="container mt-4">
      <button className="btn btn-outline-secondary mb-4" onClick={onBack}>
        ← Volver a proyectos
      </button>
      <h2 className="mb-4">Encuestas del proyecto</h2>
      <div className="row">
        {currentSurveys.map((survey, index) => {
          const { 
            questions, 
            description, 
            submissions, 
            name, 
            status, 
            dateCreated 
          } = getSurveyData(survey);

          return (
            <div key={survey.uid} className="col-md-6 mb-4">
              <div className="card shadow-sm">
                <div className="card-body">
                  <h3 className="card-title text-primary">
                    {name || `Encuesta #${indexOfFirstSurvey + index + 1}`}
                  </h3>
                  
                  <div className="mb-3">
                    <small className="text-muted">Fecha de creación: {dateCreated}</small>
                    <br/>
                    <small className="text-muted">Estado: {status}</small>
                    <br/>
                    <small className="text-muted">Respuestas: {submissions}</small>
                  </div>

                  <div className="mb-3">
                    <h5 className="text-secondary">Preguntas de la encuesta:</h5>
                    {questions.map((question, qIndex) => (
                      <div key={qIndex} className="mb-2 p-2 bg-light rounded">
                        {question}
                      </div>
                    ))}
                  </div>

                  {description && (
                    <div className="mt-3">
                      <h5 className="text-secondary">Descripción:</h5>
                      <p className="text-muted">{description}</p>
                    </div>
                  )}

                  <div className="mt-3">
                    <a 
                      href={survey.data}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="btn btn-sm btn-outline-primary"
                    >
                      Ver respuestas
                    </a>
                  </div>
                </div>
              </div>
            </div>
          );
        })}
      </div>

      <div className="d-flex justify-content-between mt-4">
        <Button onClick={prevPage} disabled={currentPage === 1}>
          Anterior
        </Button>
        <Button
          onClick={nextPage}
          disabled={currentPage === Math.ceil(surveys.length / surveysPerPage)}
        >
          Siguiente
        </Button>
      </div>
    </div>
  );
};

export default SurveyList;
